import '../Styles/Profile.modules.css';

interface Props {
    ProfileHandler: () => void;
}

function Profile({ProfileHandler} : Props) {
    return (
        <div style={{
            margin: 0,
            padding: 0,
            height: '100vh',
            background: "linear-gradient(to right, #3127A0 20%, white 80%)"}}>
            <div className="blue-half">
                <div id="website-title">Website.com</div>
            </div>
            <div className="white-half">

            </div>
        </div>
    );
}

export default Profile;
